import { useState } from 'react';
import NavComponent from "./side/NavComponent";
import Panel1Component from "./side/Panel1Component";
import Panel3Component from "./side/Panel3Component";
import Panel6Component from "./side/Panel6Component";
import Panel9Component from "./side/Panel9Component";

export default function SideComponent() {
    const [isOpen, setIsOpen] = useState(true);

    const handleToggle = () => {
        setIsOpen(prev => !prev);
    };

    // 패널
    const [activeKey, setActiveKey] = useState('gnb1'); // 초기: 선박

    const renderPanel = () => {
    switch (activeKey) {
        case 'gnb1': return <Panel1Component />;
        case 'gnb3': return <Panel3Component />;
        case 'gnb6': return <Panel6Component />;
        case 'gnb7': return <Panel9Component />;
        default: return null;
    }
    };


    return(
        <section id="sidePanel">
            <NavComponent />
            <Panel9Component
                isOpen={isOpen}
                onToggle={handleToggle}
            />
        </section>
    )
}
